import React from "react";
import icon from "../assets/icon.png";
import title from "../assets/title.png";

class Header extends React.Component {
  render() {
    return (
      <header id="header">
        <div className="logo">
          <a href="#">
            <img src={icon}></img>
            <img src={title}></img>
          </a>
        </div>
        <div className="topnav"></div>
      </header>
    );
  }
}

export default Header;
